///src/components/Card.js

import React from 'react';

const Card = ({ id, title, details, stage, onEditCard }) => {
    const cardStageClasses = {
        empathy: "bg-primary-light",
        define: "bg-success-light",
        ideate: "bg-info-light",
        prototype: "bg-warning-light", 
        test: "bg-danger-light"
      };
  return (
    <div className={`card ${cardStageClasses[stage]}`} onClick={() => onEditCard(id)}>

      <h5>{title}</h5>
    </div>
  );
};

export default Card;
